function getDateString() {
  const d = new Date();
  const year = d.getFullYear();
  let month = d.getMonth() + 1;
  if (month < 10) {
    month = `0${month}`;
  }
  let day = d.getDate();
  if (day < 10) {
    day = `0${day}`;
  }
  return `${year}-${month}-${day}`;
}

export function getWords(lang){
    switch (lang) {
        case "en":
           return englishWords; 
        case "id":
            return indonesianWords;
        case "uk":
            return ukranianWords;
        case "de":
            return germanWords;
        default:
            return englishWords;
    }
}

export function getTodaysWords(lang){
    const currentDate = getDateString();
    switch (lang) {
        case "en":
            return dateToChallengeEnglish[currentDate];
        case "id":
            return dateToChallengeIndonesian[currentDate];
        case "uk":
            return dateToChallengeUkranian[currentDate];
        case "de":
            return dateToChallengeGerman[currentDate];
        default:
            return dateToChallengeEnglish[currentDate];
    }
}


